import mode1Data from '../data/mode1.json';
import mode2Data from '../data/mode2.json';

export function loadData(mode) {
  switch (mode) {
    case 1:
      return mode1Data;
    case 2:
      return mode2Data;
    default:
      return mode1Data;
  }
}
